import React from 'react';
import PropTypes from 'prop-types';

Name.propTypes ={
    title :PropTypes.string,
    name :PropTypes.string,
    status :PropTypes.string,
    mess :PropTypes.string,
}
const Name = ({props}) => {     
     
const {title,name,status,mess} = props;
    return (
        <div className="taskItem border  mx-3">
           <label> Title: {title}</label><br></br>
           <label> Creator {name}</label><br></br>
           <label> Status {status}</label><br></br>  
           <p>
            Desscription: {mess}
           </p>
      </div>
    );
};

Name.propTypes = {
    
};

export default Name;
